			shellScript = "\n\n# shell教程：http://www.runoob.com/linux/linux-shell-variable.html\n\n# TARGET_NAMES=(\"MerculetSDKBitcode\" \"MagicWindowUAVSDKBitcode\")\n\n\n#--------------------------------------------\n#  SDK的集成打包\n#--------------------------------------------\n#####  #####\n#\n#  集成打包后形成的包分别为 \n#  国内： MerculetCNUAV MerculetCNUAVBitcode\n#  国际： MerculetSDK   MerculetSDKBitcode \n# \n#####  #####\n\nfor loop in MerculetCNUAV MerculetCNUAVBitcode\n\ndo\n\nTARGET_NAME=\"$loop\"\nUNIVERSAL_OUTPUT_FOLDER=\"${SRCROOT}/Products/\"\n\n#创建输出目录，并删除之前的framework文件\nmkdir -p \"${UNIVERSAL_OUTPUT_FOLDER}\"\nrm -rf \"${UNIVERSAL_OUTPUT_FOLDER}/${TARGET_NAME}.framework\"\n\nif loop == \"$MerculetSDKBitcode\" -o loop == \"$MagicWindowUAVSDKBitcode\"\nthen\n\n#分别编译模拟器和真机的Framework\nxcodebuild -configuration \"Release\" OTHER_CFLAGS=\"-fembed-bitcode\" -target \"${TARGET_NAME}\" -sdk iphoneos BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" clean build\nxcodebuild -configuration \"Release\" OTHER_CFLAGS=\"-fembed-bitcode\" -target \"${TARGET_NAME}\" -sdk iphonesimulator BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" clean build\n\nelse\n\n#分别编译模拟器和真机的Framework\nxcodebuild -configuration \"Release\" -target \"${TARGET_NAME}\" -sdk iphoneos BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" clean build\nxcodebuild -configuration \"Release\" -target \"${TARGET_NAME}\" -sdk iphonesimulator BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" clean build\n\nfi\n\n#拷贝framework到univer目录\ncp -R \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${TARGET_NAME}.framework\" \"${UNIVERSAL_OUTPUT_FOLDER}\"\n\n#合并framework，输出最终的framework到build目录\nlipo -create -output \"${UNIVERSAL_OUTPUT_FOLDER}/${TARGET_NAME}.framework/${TARGET_NAME}\" \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${TARGET_NAME}.framework/${TARGET_NAME}\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${TARGET_NAME}.framework/${TARGET_NAME}\"\n\n#删除编译之后生成的无关的配置文件\ndir_path=\"${UNIVERSAL_OUTPUT_FOLDER}/${TARGET_NAME}.framework/\"\nfor file in ls $dir_path\ndo\nif [[ ${file} =~ \".xcconfig\" ]]\nthen\nrm -f \"${dir_path}/${file}\"\nfi\ndone\n\n#判断build文件夹是否存在，存在则删除\nif [ -d \"${SRCROOT}/build\" ]\nthen\nrm -rf \"${SRCROOT}/build\"\nfi\n\nrm -rf \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos\"\n\n\ndone\n\n#打开合并后的文件夹\nopen \"${UNIVERSAL_OUTPUT_FOLDER}\"\n\n";
